public class ModelBiasJobDefinitionFactory(string resourceName = null, Action<Humidifier.SageMaker.ModelBiasJobDefinition> factoryAction = null) : ResourceFactory<Humidifier.SageMaker.ModelBiasJobDefinition>(resourceName)
{

    internal InnerModelBiasJobDefinitionModelBiasJobInputFactory ModelBiasJobInputFactory { get; set; }

    internal InnerModelBiasJobDefinitionMonitoringOutputConfigFactory ModelBiasJobOutputConfigFactory { get; set; }

    internal InnerModelBiasJobDefinitionStoppingConditionFactory StoppingConditionFactory { get; set; }

    internal InnerModelBiasJobDefinitionMonitoringResourcesFactory JobResourcesFactory { get; set; }

    internal InnerModelBiasJobDefinitionNetworkConfigFactory NetworkConfigFactory { get; set; }

    internal InnerModelBiasJobDefinitionModelBiasBaselineConfigFactory ModelBiasBaselineConfigFactory { get; set; }

    internal InnerModelBiasJobDefinitionModelBiasAppSpecificationFactory ModelBiasAppSpecificationFactory { get; set; }

    protected override Humidifier.SageMaker.ModelBiasJobDefinition Create()
    {
        var modelBiasJobDefinitionResult = CreateModelBiasJobDefinition();
        factoryAction?.Invoke(modelBiasJobDefinitionResult);

        return modelBiasJobDefinitionResult;
    }

    private Humidifier.SageMaker.ModelBiasJobDefinition CreateModelBiasJobDefinition()
    {
        var modelBiasJobDefinitionResult = new Humidifier.SageMaker.ModelBiasJobDefinition
        {
            GivenName = InputResourceName,
        };

        return modelBiasJobDefinitionResult;
    }
    public override void CreateChildren(Humidifier.SageMaker.ModelBiasJobDefinition result)
    {
        base.CreateChildren(result);

        result.ModelBiasJobInput ??= ModelBiasJobInputFactory?.Build();
        result.ModelBiasJobOutputConfig ??= ModelBiasJobOutputConfigFactory?.Build();
        result.StoppingCondition ??= StoppingConditionFactory?.Build();
        result.JobResources ??= JobResourcesFactory?.Build();
        result.NetworkConfig ??= NetworkConfigFactory?.Build();
        result.ModelBiasBaselineConfig ??= ModelBiasBaselineConfigFactory?.Build();
        result.ModelBiasAppSpecification ??= ModelBiasAppSpecificationFactory?.Build();
    }

} // End Of Class

